  return (
    <>
      <section className="px-10 sm:pl-0 md:pl-80 lg:md:pl-80 py-28">
        <div class="your-class">
          <div>your content</div>
          <div>your content</div>
          <div>your content</div>
        </div>
      </section>
    </>
  );
}

export default Testimonial;
